console.log("hey")

window.onload += function(){
    document.querySelectorAll('.checkbox').forEach(x => x.addEventListener('click',function(){
        console.log("re"),getCheckedBox()
    })
    )
};
function getCheckedBox(){
    var checkedBoxes = document.querySelectorAll('.checkbox');
    console.log(checkedBoxes)
}
